010000401FFF2000.description:
You will find yourself in the role of a police driver who will have to demonstrate his parking skills by driving a variety of police vehicles. Your task is to properly park official vehicles in various conditions and locations, from quiet deserted parking lots to busy streets full of other cars and obstacles.

Each mission offers unique challenges: you'll need to maneuver through narrow passages, watch out for moving vehicles, and find the optimal parking spot. Be careful and use all available skills to successfully complete each task.

The game provides a wide selection of police vehicles. Each type of transport has its own control features that need to be taken into account when parking. You'll have to adapt to different sizes and driving styles to cope with the challenges and become a true parking master!

GAME FEATURES:
• Realistic physics of driving;
• Many levels with varying difficulty;
• Huge selection of various service vehicles;

010000801E726000.description:
Get ready for an exciting basketball adventure! Test your skills and become a long shot master in this addictive game.

Your goal is simple: throw the ball into the basket. But don't let the simplicity fool you! With each level, the difficulty will increase, requiring more and more accuracy and skill from you. Test your skills on various stages, each of which presents a unique set of obstacles. As you progress through the game, your skill will increase and you will be able to perform increasingly difficult shots.

Experience the thrill of shooting the ball like never before and become a basketball legend. Get ready for an exciting adventure that will test your skills and provide hours of addictive gameplay!

GAME FEATURES:
• Excellent warm-up for accuracy;
• Many levels of varying difficulty;
• Realistic physics of ball behavior;
• Simple and minimalistic graphics;
